import './App.css';

function App() {
  return (
    <div>
       <h1>Welcome to Easy Tracking!</h1>
       <p>Login Page</p>
       <Auth />

    </div>
  );
}

function Auth() {
  return (
    <form><label for="text_form">Enter User Name: </label>
    <input type="text" id="username"></input>

      <label for="text_form">Enter Password: </label>
      <input type="text" id="password" /></form> 
  )
}

export default App;
